import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [swimmers, setSwimmers] = useState([]);
  const [form, setForm] = useState({ name: '', age: '', gender: '', classification: '' });

  useEffect(() => {
    axios.get('http://localhost:5000/swimmers').then(res => setSwimmers(res.data));
  }, []);

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = e => {
    e.preventDefault();
    axios.post('http://localhost:5000/swimmers', form).then(() => {
      axios.get('http://localhost:5000/swimmers').then(res => setSwimmers(res.data));
      setForm({ name: '', age: '', gender: '', classification: '' });
    });
  };

  return (
    <div>
      <h1>Swimmer Data Management</h1>
      <form onSubmit={handleSubmit}>
        <input name="name" value={form.name} onChange={handleChange} placeholder="Name" required />
        <input name="age" value={form.age} onChange={handleChange} placeholder="Age" required type="number" />
        <input name="gender" value={form.gender} onChange={handleChange} placeholder="Gender" required />
        <input name="classification" value={form.classification} onChange={handleChange} placeholder="Classification" />
        <button type="submit">Add Swimmer</button>
      </form>
      <h2>Swimmers List</h2>
      <ul>
        {swimmers.map(s => (
          <li key={s.id}>{s.name} ({s.age}, {s.gender}, {s.classification})</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
